import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import Footer from '../components/Footer';
import './Partners.css';

// Sample partner data - replace with actual partner information
const partners = [
  { id: 1, name: 'Partner 1', logo: '/images/partner1.png' },
  { id: 2, name: 'Partner 2', logo: '/images/partner2.png' },
  { id: 3, name: 'Partner 3', logo: '/images/partner3.png' },
  { id: 4, name: 'Partner 4', logo: '/images/partner4.png' },
  { id: 5, name: 'Partner 5', logo: '/images/partner5.png' },
  { id: 6, name: 'Partner 6', logo: '/images/partner6.png' },
  { id: 7, name: 'Partner 7', logo: '/images/partner7.png' },
  { id: 8, name: 'Partner 8', logo: '/images/partner8.png' },
];

const Partners: React.FC = () => {
  return (
    <div className="partner-page">
      <Container>
        <div className="partner-header">
          <h1>Our Partner & Collaborators</h1>
          <p>
            We collaborate with leading organizations and institutions to advance research, 
            innovation, and education in Polymer Science and Technology.
          </p>
        </div>
        
        <div className="partner-grid">
          <Row className="justify-content-center">
            {partners.map((partner) => (
              <Col key={partner.id} lg={3} md={4} sm={6} className="mb-4">
                <div className="partner-logo-container">
                  <img 
                    src={partner.logo} 
                    alt={partner.name}
                    className="partner-logo"
                  />
                </div>
              </Col>
            ))}
          </Row>
        </div>
      </Container>

      <Footer />
    </div>
  );
};

export default Partners;
